  true,\n\t\"url\": null,\n\t\"notes\": \"<p>2008-2012. Centers for Disease Control
  and Prevention (CDC).   Office on Smoking and Health (OSH) u00e2u0080u0093 Global
  Tobacco Surveillance System (GTSS) - Global Adult Tobacco Survey (GATS).    The
  Global Adult Tobacco Survey (GATS) is the global standard to systematically monitor
  adult tobacco use and track key tobacco control indicators. GATS is a nationally
  representative household survey of adults 15 years of age or older, using a standard
  protocol. It is intended to generate comparable data within and across countries.
  GATS enhances countries' capacity to design, implement and evaluate tobacco control
  interventions.</p>n\",\n\t\"license_title\": \"Other License Specified\",\n\t\"extras\":
